                $('#txtBookingId').text(data.bookingId);
                if (data.resolvedTime) {
                    $('#txtResolvedTime').text(parseDate(data.resolvedTime));
                } else {
                    $('#txtResolvedTime').text('');
                }
                $('#txtType').text(data.typeNavigation.name);
